import React from 'react';

function Footer() {
  const styles = {
    footer: {
      backgroundColor: '#D6C0B3',
      padding: '20px',
      textAlign: 'center',
      fontSize: '14px',
      fontFamily: "'Poppins', sans-serif",
      width: '100%',
      boxSizing: 'border-box',
    },
    footerContainer: {
      display: 'flex',
      justifyContent: 'space-between',
      flexWrap: 'wrap', // Ensures proper layout on smaller screens
      maxWidth: '1200px',
      margin: '0 auto', // Center the footer content
      padding: '10px 20px',
    },
    section: {
      flex: '1 1 200px', // Ensure sections have a consistent width
      marginBottom: '20px',
    },
    title: {
      fontWeight: 'bold',
      marginBottom: '10px',
    },
    list: {
      listStyle: 'none', // Remove default bullet points
      padding: 0,
      margin: 0,
    },
    listItem: {
      marginBottom: '5px',
    },
    link: {
      textDecoration: 'none',
      color: '#000', // Black text for links
    },
    linkHover: {
      color: '#D4AF37', // Gold on hover
    },
    socialIcons: {
      display: 'flex',
      justifyContent: 'center',
      gap: '10px',
    },
    copyright: {
      marginTop: '20px',
      fontSize: '12px',
      color: '#333',
    },
  };

  return (
    <footer style={styles.footer}>
      <div style={styles.footerContainer}>
        {/* Left Section */}
        <div style={styles.section}>
          <h3 style={styles.title}>L&E</h3>
          <p>CulinarEAT</p>
          <p>BY LIA & EDEN</p>
        </div>

        {/* Quick Links */}
        <div style={styles.section}>
          <h4 style={styles.title}>Quick Links</h4>
          <ul style={styles.list}>
            <li style={styles.listItem}>
              <a href="/" style={styles.link}>Home</a>
            </li>
            <li style={styles.listItem}>
              <a href="/about" style={styles.link}>About Us</a>
            </li>
            <li style={styles.listItem}>
              <a href="/contact" style={styles.link}>Contact Us</a>
            </li>
            <li style={styles.listItem}>
              <a href="/privacy" style={styles.link}>Privacy Policy</a>
            </li>
            <li style={styles.listItem}>
              <a href="/terms" style={styles.link}>Terms of Service</a>
            </li>
          </ul>
        </div>

        {/* Follow Us */}
        <div style={styles.section}>
          <h4 style={styles.title}>Follow Us</h4>
          <div style={styles.socialIcons}>
            <a href="https://facebook.com" style={styles.link}>
              Facebook
            </a>
            <a href="https://twitter.com" style={styles.link}>
              Twitter
            </a>
            <a href="https://instagram.com" style={styles.link}>
              Instagram
            </a>
            <a href="https://linkedin.com" style={styles.link}>
              LinkedIn
            </a>
          </div>
        </div>
      </div>

      {/* Copyright */}
      <div style={styles.copyright}>
        &copy; 2024 CulinarEAT by Lia & Eden. All rights reserved.
      </div>
    </footer>
  );
}

export default Footer;
